const homepageBackground = new URL("./img/homepage-bg.jpg", import.meta.url);

function Home () {
    return (
        <div class="home-page-container">
            <h1>studyPals</h1>
            <p>A productivity application to help you plan out your busy days!</p>
            <div className>
                <img src={homepageBackground}/>
            </div>
        </div>
    );
};

export default Home;
